static void
identity_set_property (GObject *object,
                       guint property_id,
                       const GValue *value,
                       GParamSpec *pspec)
{
  Identity *self = IDENTITY (object);

  switch (property_id)
  {
    case PROP_IDENTITY_ID:
      self->id = g_value_get_int64 (value);
      break;

    case PROP_IDENTITY_CONTACT:
      if (self->contact != NULL)
        g_object_unref (self->contact);
      self->contact = g_value_dup_object (value);
      self->__isset_contact = TRUE;
      break;

    case PROP_IDENTITY_USER_ID:
      self->userId = g_value_get_int (value);
      self->__isset_userId = TRUE;
      break;

    case PROP_IDENTITY_DEACTIVATED:
      self->deactivated = g_value_get_boolean (value);
      self->__isset_deactivated = TRUE;
      break;

    case PROP_IDENTITY_SAME_BUSINESS:
      self->sameBusiness = g_value_get_boolean (value);
      self->__isset_sameBusiness = TRUE;
      break;

    case PROP_IDENTITY_BLOCKED:
      self->blocked = g_value_get_boolean (value);
      self->__isset_blocked = TRUE;
      break;

    case PROP_IDENTITY_USER_CONNECTED:
      self->userConnected = g_value_get_boolean (value);
      self->__isset_userConnected = TRUE;
      break;

    case PROP_IDENTITY_EVENT_ID:
      self->eventId = g_value_get_int64 (value);
      self->__isset_eventId = TRUE;
      break;

    default:
      G_OBJECT_WARN_INVALID_PROPERTY_ID (object, property_id, pspec);
      break;
  }
}

