static void 
identity_instance_init (Identity * object)
{
  /* satisfy -Wall */
  THRIFT_UNUSED_VAR (object);
  object->id = 0;
  object->contact = g_object_new (TYPE_CONTACT, NULL);
  object->__isset_contact = FALSE;
  object->userId = 0;
  object->__isset_userId = FALSE;
  object->deactivated = 0;
  object->__isset_deactivated = FALSE;
  object->sameBusiness = 0;
  object->__isset_sameBusiness = FALSE;
  object->blocked = 0;
  object->__isset_blocked = FALSE;
  object->userConnected = 0;
  object->__isset_userConnected = FALSE;
  object->eventId = 0;
  object->__isset_eventId = FALSE;
}

static void 
identity_finalize (GObject *object)
{
  Identity *tobject = IDENTITY (object);

  /* satisfy -Wall in case we don't use tobject */
  THRIFT_UNUSED_VAR (tobject);
  if (tobject->contact != NULL)
  {
    g_object_unref(tobject->contact);
    tobject->contact = NULL;
  }
}

