GType
identity_get_type (void)
{
  static GType type = 0;

  if (type == 0) 
  {
    static const GTypeInfo type_info = 
    {
      sizeof (IdentityClass),
      NULL, /* base_init */
      NULL, /* base_finalize */
      (GClassInitFunc) identity_class_init,
      NULL, /* class_finalize */
      NULL, /* class_data */
      sizeof (Identity),
      0, /* n_preallocs */
      (GInstanceInitFunc) identity_instance_init,
      NULL, /* value_table */
    };

    type = g_type_register_static (THRIFT_TYPE_STRUCT, 
                                   "IdentityType",
                                   &type_info, 0);
  }

  return type;
}

