static void
resource_attributes_set_property (GObject *object,
                                  guint property_id,
                                  const GValue *value,
                                  GParamSpec *pspec)
{
  ResourceAttributes *self = RESOURCE_ATTRIBUTES (object);

  switch (property_id)
  {
    case PROP_RESOURCE_ATTRIBUTES_SOURCE_U_R_L:
      if (self->sourceURL != NULL)
        g_free (self->sourceURL);
      self->sourceURL = g_value_dup_string (value);
      self->__isset_sourceURL = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_TIMESTAMP:
      self->timestamp = g_value_get_int64 (value);
      self->__isset_timestamp = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_LATITUDE:
      self->latitude = g_value_get_double (value);
      self->__isset_latitude = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_LONGITUDE:
      self->longitude = g_value_get_double (value);
      self->__isset_longitude = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_ALTITUDE:
      self->altitude = g_value_get_double (value);
      self->__isset_altitude = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_CAMERA_MAKE:
      if (self->cameraMake != NULL)
        g_free (self->cameraMake);
      self->cameraMake = g_value_dup_string (value);
      self->__isset_cameraMake = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_CAMERA_MODEL:
      if (self->cameraModel != NULL)
        g_free (self->cameraModel);
      self->cameraModel = g_value_dup_string (value);
      self->__isset_cameraModel = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_CLIENT_WILL_INDEX:
      self->clientWillIndex = g_value_get_boolean (value);
      self->__isset_clientWillIndex = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_RECO_TYPE:
      if (self->recoType != NULL)
        g_free (self->recoType);
      self->recoType = g_value_dup_string (value);
      self->__isset_recoType = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_FILE_NAME:
      if (self->fileName != NULL)
        g_free (self->fileName);
      self->fileName = g_value_dup_string (value);
      self->__isset_fileName = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_ATTACHMENT:
      self->attachment = g_value_get_boolean (value);
      self->__isset_attachment = TRUE;
      break;

    case PROP_RESOURCE_ATTRIBUTES_APPLICATION_DATA:
      if (self->applicationData != NULL)
        g_object_unref (self->applicationData);
      self->applicationData = g_value_dup_object (value);
      self->__isset_applicationData = TRUE;
      break;

    default:
      G_OBJECT_WARN_INVALID_PROPERTY_ID (object, property_id, pspec);
      break;
  }
}

static void
resource_attributes_get_property (GObject *object,
                                  guint property_id,
                                  GValue *value,
                                  GParamSpec *pspec)
{
  ResourceAttributes *self = RESOURCE_ATTRIBUTES (object);

  switch (property_id)
  {
    case PROP_RESOURCE_ATTRIBUTES_SOURCE_U_R_L:
      g_value_set_string (value, self->sourceURL);
      break;

    case PROP_RESOURCE_ATTRIBUTES_TIMESTAMP:
      g_value_set_int64 (value, self->timestamp);
      break;

    case PROP_RESOURCE_ATTRIBUTES_LATITUDE:
      g_value_set_double (value, self->latitude);
      break;

    case PROP_RESOURCE_ATTRIBUTES_LONGITUDE:
      g_value_set_double (value, self->longitude);
      break;

    case PROP_RESOURCE_ATTRIBUTES_ALTITUDE:
      g_value_set_double (value, self->altitude);
      break;

    case PROP_RESOURCE_ATTRIBUTES_CAMERA_MAKE:
      g_value_set_string (value, self->cameraMake);
      break;

    case PROP_RESOURCE_ATTRIBUTES_CAMERA_MODEL:
      g_value_set_string (value, self->cameraModel);
      break;

    case PROP_RESOURCE_ATTRIBUTES_CLIENT_WILL_INDEX:
      g_value_set_boolean (value, self->clientWillIndex);
      break;

    case PROP_RESOURCE_ATTRIBUTES_RECO_TYPE:
      g_value_set_string (value, self->recoType);
      break;

    case PROP_RESOURCE_ATTRIBUTES_FILE_NAME:
      g_value_set_string (value, self->fileName);
      break;

    case PROP_RESOURCE_ATTRIBUTES_ATTACHMENT:
      g_value_set_boolean (value, self->attachment);
      break;

    case PROP_RESOURCE_ATTRIBUTES_APPLICATION_DATA:
      g_value_set_object (value, self->applicationData);
      break;

    default:
      G_OBJECT_WARN_INVALID_PROPERTY_ID (object, property_id, pspec);
      break;
  }
}

static void 
resource_attributes_instance_init (ResourceAttributes * object)
{
  /* satisfy -Wall */
  THRIFT_UNUSED_VAR (object);
  object->sourceURL = NULL;
  object->__isset_sourceURL = FALSE;
  object->timestamp = 0;
  object->__isset_timestamp = FALSE;
  object->latitude = 0;
  object->__isset_latitude = FALSE;
  object->longitude = 0;
  object->__isset_longitude = FALSE;
  object->altitude = 0;
  object->__isset_altitude = FALSE;
  object->cameraMake = NULL;
  object->__isset_cameraMake = FALSE;
  object->cameraModel = NULL;
  object->__isset_cameraModel = FALSE;
  object->clientWillIndex = 0;
  object->__isset_clientWillIndex = FALSE;
  object->recoType = NULL;
  object->__isset_recoType = FALSE;
  object->fileName = NULL;
  object->__isset_fileName = FALSE;
  object->attachment = 0;
  object->__isset_attachment = FALSE;
  object->applicationData = g_object_new (TYPE_LAZY_MAP, NULL);
  object->__isset_applicationData = FALSE;
}

static void 
resource_attributes_finalize (GObject *object)
{
  ResourceAttributes *tobject = RESOURCE_ATTRIBUTES (object);

  /* satisfy -Wall in case we don't use tobject */
  THRIFT_UNUSED_VAR (tobject);
  if (tobject->sourceURL != NULL)
  {
    g_free(tobject->sourceURL);
    tobject->sourceURL = NULL;
  }
  if (tobject->cameraMake != NULL)
  {
    g_free(tobject->cameraMake);
    tobject->cameraMake = NULL;
  }
  if (tobject->cameraModel != NULL)
  {
    g_free(tobject->cameraModel);
    tobject->cameraModel = NULL;
  }
  if (tobject->recoType != NULL)
  {
    g_free(tobject->recoType);
    tobject->recoType = NULL;
  }
  if (tobject->fileName != NULL)
  {
    g_free(tobject->fileName);
    tobject->fileName = NULL;
  }
  if (tobject->applicationData != NULL)
  {
    g_object_unref(tobject->applicationData);
    tobject->applicationData = NULL;
  }
}

