GType
resource_attributes_get_type (void)
{
  static GType type = 0;

  if (type == 0) 
  {
    static const GTypeInfo type_info = 
    {
      sizeof (ResourceAttributesClass),
      NULL, /* base_init */
      NULL, /* base_finalize */
      (GClassInitFunc) resource_attributes_class_init,
      NULL, /* class_finalize */
      NULL, /* class_data */
      sizeof (ResourceAttributes),
      0, /* n_preallocs */
      (GInstanceInitFunc) resource_attributes_instance_init,
      NULL, /* value_table */
    };

    type = g_type_register_static (THRIFT_TYPE_STRUCT, 
                                   "ResourceAttributesType",
                                   &type_info, 0);
  }

  return type;
}

