static void
shared_note_set_property (GObject *object,
                          guint property_id,
                          const GValue *value,
                          GParamSpec *pspec)
{
  SharedNote *self = SHARED_NOTE (object);

  switch (property_id)
  {
    case PROP_SHARED_NOTE_SHARER_USER_I_D:
      self->sharerUserID = g_value_get_int (value);
      self->__isset_sharerUserID = TRUE;
      break;

    case PROP_SHARED_NOTE_RECIPIENT_IDENTITY:
      if (self->recipientIdentity != NULL)
        g_object_unref (self->recipientIdentity);
      self->recipientIdentity = g_value_dup_object (value);
      self->__isset_recipientIdentity = TRUE;
      break;

    case PROP_SHARED_NOTE_PRIVILEGE:
      self->privilege = g_value_get_int (value);
      self->__isset_privilege = TRUE;
      break;

    case PROP_SHARED_NOTE_SERVICE_CREATED:
      self->serviceCreated = g_value_get_int64 (value);
      self->__isset_serviceCreated = TRUE;
      break;

    case PROP_SHARED_NOTE_SERVICE_UPDATED:
      self->serviceUpdated = g_value_get_int64 (value);
      self->__isset_serviceUpdated = TRUE;
      break;

    case PROP_SHARED_NOTE_SERVICE_ASSIGNED:
      self->serviceAssigned = g_value_get_int64 (value);
      self->__isset_serviceAssigned = TRUE;
      break;

    default:
      G_OBJECT_WARN_INVALID_PROPERTY_ID (object, property_id, pspec);
      break;
  }
}

