static void
notebook_set_property (GObject *object,
                       guint property_id,
                       const GValue *value,
                       GParamSpec *pspec)
{
  Notebook *self = NOTEBOOK (object);

  switch (property_id)
  {
    case PROP_NOTEBOOK_GUID:
      if (self->guid != NULL)
        g_free (self->guid);
      self->guid = g_value_dup_string (value);
      self->__isset_guid = TRUE;
      break;

    case PROP_NOTEBOOK_NAME:
      if (self->name != NULL)
        g_free (self->name);
      self->name = g_value_dup_string (value);
      self->__isset_name = TRUE;
      break;

    case PROP_NOTEBOOK_UPDATE_SEQUENCE_NUM:
      self->updateSequenceNum = g_value_get_int (value);
      self->__isset_updateSequenceNum = TRUE;
      break;

    case PROP_NOTEBOOK_DEFAULT_NOTEBOOK:
      self->defaultNotebook = g_value_get_boolean (value);
      self->__isset_defaultNotebook = TRUE;
      break;

    case PROP_NOTEBOOK_SERVICE_CREATED:
      self->serviceCreated = g_value_get_int64 (value);
      self->__isset_serviceCreated = TRUE;
      break;

    case PROP_NOTEBOOK_SERVICE_UPDATED:
      self->serviceUpdated = g_value_get_int64 (value);
      self->__isset_serviceUpdated = TRUE;
      break;

    case PROP_NOTEBOOK_PUBLISHING:
      if (self->publishing != NULL)
        g_object_unref (self->publishing);
      self->publishing = g_value_dup_object (value);
      self->__isset_publishing = TRUE;
      break;

    case PROP_NOTEBOOK_PUBLISHED:
      self->published = g_value_get_boolean (value);
      self->__isset_published = TRUE;
      break;

    case PROP_NOTEBOOK_STACK:
      if (self->stack != NULL)
        g_free (self->stack);
      self->stack = g_value_dup_string (value);
      self->__isset_stack = TRUE;
      break;

    case PROP_NOTEBOOK_SHARED_NOTEBOOK_IDS:
      if (self->sharedNotebookIds != NULL)
        g_array_unref (self->sharedNotebookIds);
      self->sharedNotebookIds = g_value_dup_boxed (value);
      self->__isset_sharedNotebookIds = TRUE;
      break;

    case PROP_NOTEBOOK_SHARED_NOTEBOOKS:
      if (self->sharedNotebooks != NULL)
        g_ptr_array_unref (self->sharedNotebooks);
      self->sharedNotebooks = g_value_dup_boxed (value);
      self->__isset_sharedNotebooks = TRUE;
      break;

    case PROP_NOTEBOOK_BUSINESS_NOTEBOOK:
      if (self->businessNotebook != NULL)
        g_object_unref (self->businessNotebook);
      self->businessNotebook = g_value_dup_object (value);
      self->__isset_businessNotebook = TRUE;
      break;

    case PROP_NOTEBOOK_CONTACT:
      if (self->contact != NULL)
        g_object_unref (self->contact);
      self->contact = g_value_dup_object (value);
      self->__isset_contact = TRUE;
      break;

    case PROP_NOTEBOOK_RESTRICTIONS:
      if (self->restrictions != NULL)
        g_object_unref (self->restrictions);
      self->restrictions = g_value_dup_object (value);
      self->__isset_restrictions = TRUE;
      break;

    case PROP_NOTEBOOK_RECIPIENT_SETTINGS:
      if (self->recipientSettings != NULL)
        g_object_unref (self->recipientSettings);
      self->recipientSettings = g_value_dup_object (value);
      self->__isset_recipientSettings = TRUE;
      break;

    default:
      G_OBJECT_WARN_INVALID_PROPERTY_ID (object, property_id, pspec);
      break;
  }
}

static void
notebook_get_property (GObject *object,
                       guint property_id,
                       GValue *value,
                       GParamSpec *pspec)
{
  Notebook *self = NOTEBOOK (object);

  switch (property_id)
  {
    case PROP_NOTEBOOK_GUID:
      g_value_set_string (value, self->guid);
      break;

    case PROP_NOTEBOOK_NAME:
      g_value_set_string (value, self->name);
      break;

    case PROP_NOTEBOOK_UPDATE_SEQUENCE_NUM:
      g_value_set_int (value, self->updateSequenceNum);
      break;

    case PROP_NOTEBOOK_DEFAULT_NOTEBOOK:
      g_value_set_boolean (value, self->defaultNotebook);
      break;

    case PROP_NOTEBOOK_SERVICE_CREATED:
      g_value_set_int64 (value, self->serviceCreated);
      break;

    case PROP_NOTEBOOK_SERVICE_UPDATED:
      g_value_set_int64 (value, self->serviceUpdated);
      break;

    case PROP_NOTEBOOK_PUBLISHING:
      g_value_set_object (value, self->publishing);
      break;

    case PROP_NOTEBOOK_PUBLISHED:
      g_value_set_boolean (value, self->published);
      break;

    case PROP_NOTEBOOK_STACK:
      g_value_set_string (value, self->stack);
      break;

    case PROP_NOTEBOOK_SHARED_NOTEBOOK_IDS:
      g_value_set_boxed (value, self->sharedNotebookIds);
      break;

    case PROP_NOTEBOOK_SHARED_NOTEBOOKS:
      g_value_set_boxed (value, self->sharedNotebooks);
      break;

    case PROP_NOTEBOOK_BUSINESS_NOTEBOOK:
      g_value_set_object (value, self->businessNotebook);
      break;

    case PROP_NOTEBOOK_CONTACT:
      g_value_set_object (value, self->contact);
      break;

    case PROP_NOTEBOOK_RESTRICTIONS:
      g_value_set_object (value, self->restrictions);
      break;

    case PROP_NOTEBOOK_RECIPIENT_SETTINGS:
      g_value_set_object (value, self->recipientSettings);
      break;

    default:
      G_OBJECT_WARN_INVALID_PROPERTY_ID (object, property_id, pspec);
      break;
  }
}

