  object->name = NULL;
  object->__isset_name = FALSE;
  object->updateSequenceNum = 0;
  object->__isset_updateSequenceNum = FALSE;
  object->defaultNotebook = 0;
  object->__isset_defaultNotebook = FALSE;
  object->serviceCreated = 0;
  object->__isset_serviceCreated = FALSE;
  object->serviceUpdated = 0;
  object->__isset_serviceUpdated = FALSE;
  object->publishing = g_object_new (TYPE_PUBLISHING, NULL);
  object->__isset_publishing = FALSE;
  object->published = 0;
  object->__isset_published = FALSE;
  object->stack = NULL;
  object->__isset_stack = FALSE;
  object->sharedNotebookIds = g_array_new (0, 1, sizeof (gint64));
  object->__isset_sharedNotebookIds = FALSE;
  object->sharedNotebooks = g_ptr_array_new_with_free_func (g_object_unref);
  object->__isset_sharedNotebooks = FALSE;
