static void 
notebook_finalize (GObject *object)
{
  Notebook *tobject = NOTEBOOK (object);

  /* satisfy -Wall in case we don't use tobject */
  THRIFT_UNUSED_VAR (tobject);
  if (tobject->guid != NULL)
  {
    g_free(tobject->guid);
    tobject->guid = NULL;
  }
  if (tobject->name != NULL)
  {
    g_free(tobject->name);
    tobject->name = NULL;
  }
  if (tobject->publishing != NULL)
  {
    g_object_unref(tobject->publishing);
    tobject->publishing = NULL;
  }
  if (tobject->stack != NULL)
  {
    g_free(tobject->stack);
    tobject->stack = NULL;
  }
  if (tobject->sharedNotebookIds != NULL)
  {
    g_array_unref (tobject->sharedNotebookIds);
    tobject->sharedNotebookIds = NULL;
  }
  if (tobject->sharedNotebooks != NULL)
  {
    g_ptr_array_unref (tobject->sharedNotebooks);
    tobject->sharedNotebooks = NULL;
  }
  if (tobject->businessNotebook != NULL)
  {
    g_object_unref(tobject->businessNotebook);
    tobject->businessNotebook = NULL;
  }
  if (tobject->contact != NULL)
  {
    g_object_unref(tobject->contact);
    tobject->contact = NULL;
  }
  if (tobject->restrictions != NULL)
  {
    g_object_unref(tobject->restrictions);
    tobject->restrictions = NULL;
  }
  if (tobject->recipientSettings != NULL)
  {
    g_object_unref(tobject->recipientSettings);
    tobject->recipientSettings = NULL;
  }
}

